import React, {useState} from "react";
import "./App.css";

function APP(){
return (
//MAIN WRAPPER DIV FOR ENTIRE PAGE
    <div className="login-container">
      <h1>Student Login</h1>	//PAGE TITLE

//LOGIN FORM STARTS HERE
      <form className="login-form">
        <label htmlFor="email">Email:</label>	//EMAIL LABEL AND INPUT
        <input
          id="email"
          type="email"
          placeholder="Enter your email"
          required
        />

        <label htmlFor="password">Password:</label>	//PASSWORD LABEL AND INPUT
        <input
          id="password"
          type="password"
          placeholder="Enter your password"
          required
        />

        <button type="submit">Log In</button>	//SUBMIT BUTTON
      </form>

      <p className="forgot-password">	//FORGOT PASSWORD LINK
        <a href="#">Forgot your password?</a>
      </p>
    </div>
  );
}

export default App;
